Sophie Raworth and Gareth Malone host highlights of a 
spectacular gala staged in the gardens of Buckingham Palace
to mark the 60th anniversary of Her Majesty the Queen's coronation.

Performers including Dame Kiri Te Kanawa, English National 
Ballet, The Feeling, Katherine Jenkins and Russell Watson 
are amongst those representing talent from across the UK 
and the Commonwealth.

With Buckingham Palace providing the stunning back-drop, 
the event celebrates music, dance and entertainment from 
throughout the Queen's reign.

